import "./Loja.css";

function Loja () {

    return (
        <div id="lojabg">
            <div class="card" id="firstCard">
                <div>
                     <h3 id="cardText">Quer desconto na mensalidade da faculdade?</h3>
                     <h4 id="cardSubText">Verifique se sua faculdade faz parte do programa</h4>
                </div>
                <img src="mdi_piggy-bank-outline.svg"></img>
            </div>
        </div>
    );
}

export default Loja;
